import NotasView from "./page/notasView";
import Login from "./page/login";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Layout />}>
          <Route index element={<Login />} />
          <Route path="/notas" element={<NotasView />} />          
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
